//
// test-cases are generated by this script
//
// for j in $(seq 1 100)
// do
// for i in $(seq $((($RANDOM % 256) + 1)))
// do
// od -vAn -N4 -td4 < /dev/urandom
// done \
// | tr "\n" "," \
// | sed "s/, */,/g" \
// | sed "s/^/    @Test fun test$j() = helper(intArrayOf(/g" \
// | sed "s/$/))/g"
// echo
// done
class Tests {

    fun helper(data: IntArray) {
        var dataoff = 0
        executeBufferManagerTest(
            { data[dataoff++] },
            { data.size - dataoff },
            { dataoff = 0 },
            { it -> BufferManager(it) },
            BufferManagerExt.isInMemoryOnly,
            { it -> BufferManagerExt.allowInitFromDisk = it },
            true,
        )
    }

